import isPlainObject from "@hoge1e3/is-plain-object";
import * as assert from "assert";
export async function main(){
    assert.ok(isPlainObject({x:3}),"x");
    assert.ok(!isPlainObject(123),"123");
    assert.ok(!isPlainObject(document),"doc");
    assert.ok(!isPlainObject(new Date()),"dat");
    assert.ok(!isPlainObject(Object),"Object");
    assert.ok(!isPlainObject(isPlainObject),"function");
    
    this.echo("passed");
}    
